import React, { useEffect, useState } from 'react';
import NavBack from '../../Components/Contents/NavBack';
import LibraryList from './LibraryList';
import { getLibraryAPI } from '../../apis/library';
import { LibraryType } from '../../Store/Types';

export default function Library() {
    const [libs, setLibs] = useState<LibraryType[]>([])
    const ISBN = 9791168473690
    const regionCode = 24

    useEffect(() => {
        // 도서 소장 도서관 조회
        getLibrary
    })

    const getLibrary = async () => {
        const data = await getLibraryAPI(ISBN, regionCode)
        console.log(data)

        let tmp: LibraryType[] = []
        data.forEach((lib: any) => {
            console.log(lib)
            tmp.push({
                libCode: Number(lib.libCode),
                libName: lib.libName,
                address: lib.address,
                latitude: Number(lib.latitude),
                longitude: Number(lib.longitude),
                homepage: lib.homepage,
                closed: lib.closed,
                operatingTime: lib.operatingTime,
                tel: lib.tel,
            })
        })
        setLibs(tmp)
    }

    return (
        <>
            <NavBack text="'불편한 편의점' 도서관 정보" link="-1" />
            <LibraryList />
            <button onClick={() => getLibrary()}>조회</button>
            {JSON.stringify(libs)}
        </>
    );
}
